import React from 'react';
import Header from '../components/Header';
import '../styles/ecommerce.css';

class Ecomerce extends React.Component{
    render() {
        return (
          <div>
              <Header />
              <section>
                <img className='logoGQF' alt='logoGQF' src={`https://scontent.fldb1-1.fna.fbcdn.net/v/t1.6435-9/50234276_2039919682754418_5925048599061725184_n.jpg?_nc_cat=106&ccb=1-5&_nc_sid=09cbfe&_nc_eui2=AeGYm19j7Nf9wwoS_JnDPN3fJcNIaWBZFoglw0hpYFkWiAi-cRFVlQlIN04IW8Jz05B01pg_vtcFXmJrtHfzhvLW&_nc_ohc=7Crfir7Kmc4AX_nXgzV&tn=yo4mCv-6Cay_Gace&_nc_ht=scontent.fldb1-1.fna&oh=00_AT-dNJSzGaeK5NLnydZqZjr4Nk01BZY_G4dlQlMGCzw8PA&oe=6244D8CF`}/>
                </section>
                <h1 class="text-3xl font-bold underline">Produção Artesanal</h1>
                <div class="grid grid-cols-4 gap-4 duration-[2000ms]">
                <img className='fotoProduto' alt='Luminária Preta' src={`https://scontent.fldb1-1.fna.fbcdn.net/v/t39.30808-6/240401097_4239697366109961_804689760312366104_n.jpg?_nc_cat=100&ccb=1-5&_nc_sid=a26aad&_nc_eui2=AeG9GTGCvpZzfMZvmWLGnYgmwMUp5e0CcK3AxSnl7QJwrdFhYdbMTCxmLxcVP6xZj75nAWHtTuzWZSilk8N4me5A&_nc_ohc=ZTjBvbQVOoAAX9aZjTr&_nc_ht=scontent.fldb1-1.fna&oh=00_AT98zZJtlX1LARcnrelo6tDRUCWofZ2gLuxBXMLcb2hugA&oe=6224900B`}></img>
                <button class="transition duration-150 ease-in-out ...">Button A</button>
                <img className='fotoProduto rounded-full' alt='Cachepô pássaro' src={`https://scontent.fldb1-1.fna.fbcdn.net/v/t39.30808-6/274758205_4860549047358120_6481097652118836920_n.jpg?_nc_cat=102&ccb=1-5&_nc_sid=a26aad&_nc_eui2=AeFzDRdPgd6GFVVVV0pApvQUgP4RtVbUKF2A_hG1VtQoXTfi9xESkqvqmf05RqdbZCOOCvTqQ9doewuZsnlLV5e6&_nc_ohc=KRNqeavwgTUAX9shN4x&_nc_ht=scontent.fldb1-1.fna&oh=00_AT90PvaF1KYea6CJDdSMVLQKegR9HY2aNZP0Z0UptFIUAA&oe=62249F6E`}></img>
                <img className='fotoProduto' alt='Espelho Preto' src={`https://scontent.fldb1-1.fna.fbcdn.net/v/t39.30808-6/274876904_4860549710691387_3609296280351849286_n.jpg?_nc_cat=103&ccb=1-5&_nc_sid=a26aad&_nc_eui2=AeEAFc1eJkGtrF9fhCjcW2Wv6-xMc_PLUTzr7Exz88tRPDUSrcPhCNdQdTTnLc9HlebzemoUlir1ZfOPB47vp3pz&_nc_ohc=I7pj_692u04AX-1bg9u&tn=yo4mCv-6Cay_Gace&_nc_ht=scontent.fldb1-1.fna&oh=00_AT8wjd3Ezb4N4BgKd7lSk2qQSVTvqWNGnrCdjHeLtGm1og&oe=6224E351`}></img>
                <img className='fotoProduto' alt='Relogio Duo e Gamela' src={`https://scontent.fldb1-1.fna.fbcdn.net/v/t1.6435-9/197072399_4004716062941427_4169549782737095758_n.jpg?_nc_cat=104&ccb=1-5&_nc_sid=a26aad&_nc_eui2=AeFwIcbY7wtG-uk2a2uDfrAZhJqoni9bjNOEmqieL1uM09YwaBwRPKOmpMcPIGGZ7b98uZWoJKxw8Wm5DfIU_AcO&_nc_ohc=j_opVMObtH4AX-2ihCT&_nc_ht=scontent.fldb1-1.fna&oh=00_AT81XdP6RoHZVqR6Xgr7mJbNxWhElkRFfWDuFwSw1UTvtA&oe=6244E5DA`}></img>
                <img className='fotoProduto' alt='Caixa Verde Doce' src={`https://scontent.fldb1-1.fna.fbcdn.net/v/t39.30808-6/275053540_4860559887357036_3651364802008632603_n.jpg?_nc_cat=109&ccb=1-5&_nc_sid=a26aad&_nc_eui2=AeF8MV7E0ECmQ0asv9usR6pmC7Ks6rXfANALsqzqtd8A0N6FuKvLybL7BFbw_yc2Aarx_Y0DCDAlwZ43GCrzGFlf&_nc_ohc=-d6HmWpnly8AX8JbEjW&_nc_ht=scontent.fldb1-1.fna&oh=00_AT-m7-MmrzeI3cCH316wE2u_nqYwL7ZFngIZoDOJ2lHtpw&oe=62242D0A`}></img>
                <img className='fotoProduto' alt='Poltrona Pet' src={`https://scontent.fldb1-1.fna.fbcdn.net/v/t39.30808-6/274981720_4860558400690518_8185951658261020718_n.jpg?_nc_cat=102&ccb=1-5&_nc_sid=a26aad&_nc_eui2=AeFzII8fxVZCyFzXH0WMxT7tYx0ZxzIDUHFjHRnHMgNQcRMkIBs1wgxnAfdgybaDgzKBvrXON7nfgrXrT5GWST81&_nc_ohc=fd7_7M8CAgoAX8o2CMr&_nc_ht=scontent.fldb1-1.fna&oh=00_AT_x7DWqSfNkkK-pixwSKNeQLOHoobeKax6FObd8-hpBWg&oe=62254548`}></img>
                <img className='fotoProduto' alt='Relógio Meio a Meio' src={`https://scontent.fldb1-1.fna.fbcdn.net/v/t39.30808-6/275049750_4860557370690621_9030656502125107782_n.jpg?_nc_cat=111&ccb=1-5&_nc_sid=a26aad&_nc_eui2=AeFcCkO71DtvtOpn8hv7DzRgJ4N_gVrzpAkng3-BWvOkCQK6SUJvi6XNaajH6OBJV_1vLh7DEIyIIV2Yqn7DRwev&_nc_ohc=8QYpCI11HMMAX_J1Kp-&tn=yo4mCv-6Cay_Gace&_nc_ht=scontent.fldb1-1.fna&oh=00_AT8LeISZirL_toqi0jki48X4MTtDVyhtVIWweDtzbzdnGw&oe=62237ACC`}></img>
                <img className='fotoProduto' alt='Relogio Organico e Geometrico' src={`https://scontent.fldb1-1.fna.fbcdn.net/v/t39.30808-6/275065648_4860652287347796_9170846348696585860_n.jpg?stp=dst-jpg_p526x296&_nc_cat=102&ccb=1-5&_nc_sid=a26aad&_nc_eui2=AeEMw-V2Dt9cXe5LlMK-JjteFnBHCUXAZH8WcEcJRcBkf3e2Xf0IgtI-oFZotcbv153vPlYcdykLsoWzyaeIWsNV&_nc_ohc=R3CgEwGySGMAX8JBixR&_nc_ht=scontent.fldb1-1.fna&oh=00_AT-knjMsQ3rV7val822-ZfitT1UV_xRbdh2box4YgtFrzA&oe=6223925E`}></img>
                <img className='fotoProduto' alt='Relógio Alça Macramê' src={`https://scontent.fldb1-1.fna.fbcdn.net/v/t39.30808-6/274993123_4860651374014554_8968801766234657836_n.jpg?_nc_cat=100&ccb=1-5&_nc_sid=a26aad&_nc_eui2=AeH9XHjTUhdsiGczkzPC8iyaHmk7Kycd8aYeaTsrJx3xpramUuiOt8I34CXThcLWcr11sMEzdpgiG2sYDYwQ8_3T&_nc_ohc=tu8bd4K12S0AX9hSlBl&tn=yo4mCv-6Cay_Gace&_nc_ht=scontent.fldb1-1.fna&oh=00_AT9DvDk58RfCaa-GUb99_lVDuN_GZyglfMWe9E8sRZGejg&oe=622448E2`}></img>
                </div>
              </div>
        )
    }
}

export default Ecomerce;
